sal_id           NUMBER (3));
ALTER TABLE PACIENTE ADD CONSTRAINT PK_PACIENTE PRIMARY KEY (pac_run); 


CREATE TABLE ATENCION(
ate_id      NUMBER (8) NOT NULL,
fecha_atencion DATE NOT NULL,
